// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'; // This import should match the default export in App.js
import { AuthProvider } from './AuthContext';

ReactDOM.render(
    <AuthProvider>
        <App />
    </AuthProvider>,
    document.getElementById('root')
);
